The key observation is that the start symbol S can only expand to either NT2 NT26 or NT18 NT11, so the very first terminal of any S‐derivation must come from either NT2 or NT18.  If you compute the “possible first terminals” of NT2 and of NT18 by inspecting their productions (and recursing through their binary expansions), you find

  First(NT2) ⊆ {t42, t26, t41, t55, t4, t27, t38}  
  First(NT18) ⊆ {t57, t42, t26, t41, t55, t4, t27, t38, t54, t23}

neither of which contains t47.  Since the given string starts with t47, no derivation from S can match it.  

